import React from "react";
import "./styles/GridLayout.css";

const FilterSelect = props => {
  return (
    <div id="topBar" class="col-11">
      <label> Sortieren nach: </label>
      <select name="Sortieren nach">
        <option> Datum (aufsteigend)</option>
        <option> Datum (absteigend)</option>
        <option> Kosten (aufsteigend)</option>
        <option> Kosten (absteigend)</option>
        <option> Name (aufsteigend)</option>
        <option> Name (absteigend)</option>
      </select>
    </div>
  );
};

export default FilterSelect;
